import Head from 'next/head';
import { Container, Jumbotron } from 'reactstrap';

function Home() {
    return (
        <>
            <Head>
                <title>Home - DeCExclusiveStore</title>
                <meta name="descripton" content="Site de Semi Joias" />
                <meta name="author" content="DeCSoftwares" />
            </Head>

            <Jumbotron fluid className="descr-top">
                <style>
                    {`.descr-top{
                   text-align: right;
                   margin-botton: 0rem !important
                   height: 5px;
                }`}
                </style>
                <Container>
                    (11)95915-7914  decexclusivestore@gmail.com
            </Container>
            </Jumbotron>


            <Jumbotron fluid className="fundo">
                <style>
                    {`.fundo{
                background-color: #FFF8FD;
                   text-align: right;
                   margin-botton: 0rem !important
                   height: 5px;
                }`}
                </style>
                <Container>
                    <div className="row">
                        <div className="col-md-3">
                            A
                         </div>
                        <div className="col-md-3">
                            B
                        </div>
                        <div className="col-md-3">
                            C
                        </div>
                        <div className="col-md-3">
                            D
                        </div>
                    </div>
                </Container>
            </Jumbotron>
        </>
    );
};

export default Home;
